import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';


function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <h1 className='more'>Previna-te da covid-19 e fique ligado</h1>; 
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
